import React from 'react';
import '../styles/Header.css';

const Header: React.FC = () => (
  <header className="header">
    <h1>UI Challenge 10</h1>
    <nav>
      <a href="#">Home</a>
      <a href="#">Contact</a>
    </nav>
  </header>
);

export default Header;
